import React from 'react';
import './App.css';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Link from 'react-router'
import Home from "./pages/home";
import Projects from "./pages/projects";
import Skills from "./pages/skills";

function App() {

    const textStyle = {
        color: "#34A4EB",
        fontSize: "16px"
    };

    return (
        <div className="App bg">

            <Navbar bg="dark" expand="lg">
                <Navbar.Brand className="ml-2" style={{color: "#34A4EB", fontSize: "20px"}}>Alper Tunca</Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav mr-1" style={{backgroundColor: "#34A4EB"}}/>
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav
                          className="ml-auto mr-2">
                        <Nav.Link href="/home" style={textStyle} >Home</Nav.Link>
                        <Nav.Link href="/projects" style={textStyle} >Projects</Nav.Link>
                        <Nav.Link href="/skills" style={textStyle} >Skills</Nav.Link>

                    </Nav>
                </Navbar.Collapse>
            </Navbar>
            <Link to="/home">Home</Link>
        </div>
    );
}

export default App;
